DEFENDANT MUST POST $500 CASH

Defendant shall not possess or consume alcohol. Defendant is not to enter any bars, taverns, or liquor stores. Defendant shall not possess or use illegal drugs or drug paraphernalia. Defendant will not possess any firearms, ammunition or other weapons. Defendant will not in any way contact or attempt to contact any victim(s) listed and will avoid their residence/place of employment or any place they are located and will avoid causing any other person, other than defendant's attorney, from doing so on defendant's behalf.  The term "no contact" is hereby defined as through the mail, by telephone, by way of electronic device, in person, or through a third party.  VICTIM(S)/RESIDENCE(S): NO CONTACT WITH A.M. OR RESIDENCE. If defendant and victim(s) are living together, defendant may go to their residence once with a police officer to retrieve the defendant's personal belongings. Defendant shall personally ensure that payments are made under any Order for Income Withholding if the Court appoints an attorney for the defendant. 
